import React from 'react'
import SearchList from '../components/SearchList';
import config from '../config.json';
import style from 'styled-components';

const request = require('request');

const NominateTitle = style.h1`

  color: white;
  font-weight: bold;
  text-align: left;
  font-size: 48px;
  margin-bottom: 73px;

`;

const Form = style.input`

    width: 100%;
    height: 31px;
    color: white;
    font-size: 18px;
    font-weight: 400;
    background-color: transparent;
    border-style: solid;
    border-top: 0;
    border-left: 0;
    border-right: 0;
    border-bottom: 5px solid white;

    &::placeholder {
        font-size: 18px;
        color: #E3E3E3;
        font-weight: 400;
    }

`;

const Wrapper = style.div`

  margin: 10.21% 22% 5.07% 22%;

`;


export default function Nominate() {

    const [searchInput, setInput] = React.useState("")
    const [searchOutput, setOuput] = React.useState([])

    React.useEffect(() => {
        request(`http://www.omdbapi.com/?apikey=27d6492d&t=Black-rPanthe`, { json: true }, (err, res, body) =>  {
            if (err) { return console.log(err); }
            console.log(body);
            console.log(body.explanation);
        });
    })
    return (
        <Wrapper>
            <NominateTitle>
                Start Nominating
            </NominateTitle>
            <Form placeholder="Search for film title (or not up to you)"/>
            <SearchList/>
        </Wrapper>
    );
}
